        public override IEnumerable<ILink> Links => GetLinks();
        private IEnumerable<ILink> GetLinks()
        {
            foreach (var item in base.Links)
            {
                yield return item;
            }
            foreach (var item in Factions.SelectMany(f => f.Links))
            {
                yield return item;
            }
            yield return DeathItem_Property;
            yield return Race_Property;
            foreach (var item in Spells)
            {
                yield return item;
            }
            yield return Script_Property;
            foreach (var item in Items.SelectMany(f => f.Links))
            {
                yield return item;
            }
            foreach (var item in AIPackages)
            {
                yield return item;
            }
            yield return Class_Property;
            yield return Hair_Property;
            foreach (var item in Eyes)
            {
                yield return item;
            }
            yield return CombatStyle_Property;
            yield break;
        }

        public override void Link<M>(
            ModList<M> modList,
            M sourceMod,
            NotifyingFireParameters cmds = null)
            
        {
            base.Link(
                modList,
                sourceMod,
                cmds);
            foreach (var item in Factions)
            {
                item.Link(
                    modList,
                    sourceMod,
                    cmds);
            }
            DeathItem_Property.Link(
                modList,
                sourceMod,
                cmds);
            Race_Property.Link(
                modList,
                sourceMod,
                cmds);
            foreach (var item in Spells)
            {
                item.Link(
                    modList,
                    sourceMod,
                    cmds);
            }
            Script_Property.Link(
                modList,
                sourceMod,
                cmds);
            foreach (var item in Items)
            {
                item.Link(
                    modList,
                    sourceMod,
                    cmds);
            }
            foreach (var item in AIPackages)
            {
                item.Link(
                    modList,
                    sourceMod,
                    cmds);
            }
            Class_Property.Link(
                modList,
                sourceMod,
                cmds);
            Hair_Property.Link(
                modList,
                sourceMod,
                cmds);
            foreach (var item in Eyes)
            {
                item.Link(
                    modList,
                    sourceMod,
                    cmds);
            }
            CombatStyle_Property.Link(
                modList,
                sourceMod,
                cmds);
        }

